   COMMENT ON COLUMN "DBSQL"."M_TEST2"."PID" IS 'Transaction is a set of multiple T SQL statements that are executed together as a single executable unit. If all of the T SQL statements are executed successfully then the transaction get Commited otherwise the transaction get Roll backed.  Transaction is very important for database while working on multiple tables. If there is dependency of data in one table to another table there we should use transaction There are two types of transactions, 1.	Implicit transaction: Implicit transaction are maintain by SQL server for each DDL statement executed on server  2.	Explicit transaction 3.	Explicit transaction are explicitly executed by user on the T SQL statement written by him.   Ex . BEGIN TRANSACTION  trans BEGIN TRY Multiple SQL statements to execute IF (@@TRANSROWCOUNT>0) BEGIN  COMMIT  TRANSACTION trans END END TRY BEGIN CATCH  PRINT?Error Occured? IF (@@TRANSROWCOUNT>0) BEGIN  ROLLBACK TRANSACTION trans END END CATCH. ';
