   COMMENT ON COLUMN "DBSQL"."M_TEST21"."PID" IS '1. set serveroutput on  2. creating variables  	declare 		name varchar(20);  3. assigning values 	name := ''Matin Sayed'';  4. Printing information 	dbms_output.put_line(name);  5. Writing CASE statement declare  name varchar(20); begin 	name := ''Matin Sayed''; 	CASE name 	 	when ''Matin Sayed''  			THEN dbms_output.put_line(''GOOD''); 		else  			dbms_output.put_line(''BAD''); 	END CASE; end;  6. Writing IF statement 	DECLARE       		D VARCHAR2(3):= TO_CHAR(SYSDATE,''DY''); 	BEGIN 	   	IF  D= ''SAT'' THEN  			       DBMS_OUTPUT.PUT_LINE(''ENJOY YOUR WEEKEND''); 		ELSIF  D= ''SUN'' THEN         			       DBMS_OUTPUT.PUT_LINE(''ENJOY YOUR WEEKEND'');    		ELSE        			       DBMS_OUTPUT.PUT_LINE(''HAVE A NICE DAY '');    		END IF; 	END;      7. Looping in PLSQL  DECLARE    N NUMBER:=1; BEGIN    LOOP      DBMS_OUTPUT.PUT_LINE (N);      N := N + 1;      EXIT When N>5;    END LOOP; END; /  8. writing comments 	<< your comment >>   9. DECLARE   N NUMBER :=1; BEGIN   WHILE N<=5       LOOP       DBMS_OUTPUT.PUT_LINE ( N );       N := N + 1;     END LOOP; END; // ';
