--  DDL for Trigger UPDATECATEGORYSTATS
--------------------------------------------------------

  CREATE OR REPLACE TRIGGER "DBSQL"."UPDATECATEGORYSTATS" 
AFTER INSERT OR DELETE OR UPDATE ON book
DECLARE
CURSOR c_stats IS
  SELECT categoryid, count(*) total_books, AVG(bookprice) avg_price
  FROM book 
  GROUP BY categoryid;
BEGIN
DELETE FROM category_stats;
FOR v_record IN c_stats LOOP
  INSERT INTO category_stats(category, total_books, average_price)
    VALUES(v_record.categoryid, v_record.total_books, v_record.avg_price);
END LOOP;
END UpdateCategoryStats;
/
ALTER TRIGGER "DBSQL"."UPDATECATEGORYSTATS" ENABLE;
