--  DDL for Function ANNUAL_COMP
--------------------------------------------------------

  CREATE OR REPLACE FUNCTION "DBSQL"."ANNUAL_COMP" 
(P_MONTLYSAL IN INTEGER, P_COMMISSION IN INTEGER)
RETURN NUMBER AS P_NEWSAL NUMBER(10,2);
BEGIN
  P_NEWSAL := NVL(P_MONTLYSAL, 0) * 12;	
  P_NEWSAL := P_NEWSAL + NVL(P_COMMISSION,0) * P_NEWSAL * (12/ 100);	
  
	RETURN P_NEWSAL;	
END ANNUAL_COMP

/

--------------------------------------------------------
--  DDL for Function ANNUAL_COMP2
--------------------------------------------------------

  CREATE OR REPLACE FUNCTION "DBSQL"."ANNUAL_COMP2" 
(P_SALARY IN INTEGER, P_COMMISSION IN INTEGER)
RETURN NUMBER AS P_NEWSAL NUMBER(10,2)  NOT NULL DEFAULT 0 ;
BEGIN

  P_NEWSAL := NVL(P_SALARY, 0)*12 + NVL(P_COMMISSION,0)*NVL(P_SALARY, 0)*12/100;
  
	RETURN P_NEWSAL;	
END ANNUAL_COMP2;


/

