  CREATE OR REPLACE FUNCTION "DBSQL"."ANNUAL_COMP991" 
(P_CURRENTSAL IN NUMBER(8,2), P_COMM IN NUMBER(2,2))
RETURN EMPLOYEES.SALARY%TYPE AS P_NEWSAL EMPLOYEES.SALARY%TYPE;
BEGIN
	IF (UPPER(P_JOBID) = 'IT_PROG') THEN
		P_NEWSAL := P_CURRENTSAL * 1.2;
	ELSIF (UPPER(P_JOBID) = 'SA_MAN')THEN
		P_NEWSAL := P_CURRENTSAL * 1.1;
	ELSIF (UPPER(P_JOBID) = 'ST_CLERK') THEN
		P_NEWSAL := P_CURRENTSAL * 1.05;
	ELSE
		P_NEWSAL := P_CURRENTSAL;		
	END IF;
	RETURN P_NEWSAL;	
END ANNUAL_COMP991;

