--  DDL for Function E15
--------------------------------------------------------

  CREATE OR REPLACE FUNCTION "DBSQL"."E15" (en employees.employee_id%type) return employees.salary%type is
deptype employees.department_id%type;
sal employees.salary%type;
begin
   select department_id into deptype from employees where employee_id=en;
   if deptype = 'IT_PROG'
   then
     update employees set salary=salary*1.2 where employee_id=en;
   elsif deptype = 'SA_MAN'
   then
     update employees set salary=salary*1.1 where employee_id=en;
   elsif deptype = 'ST_CLERK'
   then
     update employees set salary=salary*1.05 where employee_id=en;
   end if;
    select salary into sal from employees where employee_id=en;
    return sal;
end;

/

