--  DDL for Function FINDSALARY
--------------------------------------------------------

  CREATE OR REPLACE FUNCTION "DBSQL"."FINDSALARY" 
          ( name_in IN varchar2 )
           RETURN number
       IS
            salary number;
  
            cursor c1 is
            select total
              from stud_details
             where name = name_in;
 
       BEGIN
 
           open c1;
           fetch c1 into salary;
 
           if c1%notfound then
                salary := 9999;
           end if;
 
           close c1;
 
       RETURN salary;
 
       EXCEPTION
       WHEN OTHERS THEN
             raise_application_error(-20001,'An error was encountered - '||SQLCODE||' -ERROR- '||SQLERRM);
       END;

