UPDATEDSAL EMPLOYEES.SALARY%TYPE;
  BEGIN
  IF JOB_ID='IT_PROG'
  THEN UPDATEDSAL:=RISE+(0.2*RISE);
  ELSIF JOB_ID='SA_MAN'
