   V_SAL EMPLOYEES.SALARY%TYPE;
BEGIN
   IF P_JOB_ID = 'IT_PROG'
    THEN
           SELECT SALARY INTO V_SAL FROM EMPLOYEES WHERE JOB_ID= P_JOB_ID;
           P_SAL := V_SAL  + V_SAL* 0.20;
   ELSIF  P_JOB_ID = 'SA_MAN'
    THEN
           SELECT SALARY INTO V_SAL FROM EMPLOYEES WHERE JOB_ID= P_JOB_ID;
           P_SAL := V_SAL  + V_SAL* 0.10;
   ELSIF  P_JOB_ID = 'ST_CLERK'
    THEN
           SELECT SALARY INTO V_SAL FROM EMPLOYEES WHERE JOB_ID= P_JOB_ID;
           P_SAL := V_SAL  + V_SAL* 0.20;
   ELSE
           P_SAL := 0;
   END IF;
 END FU_EMP_SAL_CAL_PREM;

