					return employees.salary%type is
v_new_Sal employees.salary%type;
 begin
    if(p_jobid='IT_PROG') then
        v_new_Sal:=p_currsalary+p_currsalary*(20/100);
    ELSIF(P_JOBID='SA_MAN')then
