--------------------------------------------------------
--  DDL for Function SABY_ANNUAL_COMP
--------------------------------------------------------

  CREATE OR REPLACE FUNCTION "DBSQL"."SABY_ANNUAL_COMP" 
( SALARY IN NUMBER
, COMMISSION IN NUMBER
) 

RETURN NUMBER AS V_NEWSAL NUMBER(10,2);

BEGIN
  
  IF salary is null then 
   V_NEWSAL := 0;
  ELSE
  
    IF commission is null THEN 
       V_NEWSAL := salary + (0* salary);   
    ELSIF commission > 1 then 
      V_NEWSAL := salary + ((commission/100)* salary);
    ELSE
      V_NEWSAL := salary + (commission* salary);
    END IF;
  END IF;
  

  RETURN V_NEWSAL;
END SABY_ANNUAL_COMP;

/

