--  DDL for Function TRIANGLE
--------------------------------------------------------

  CREATE OR REPLACE FUNCTION "DBSQL"."TRIANGLE" (a number,b number,c number) RETURN boolean AS invalid_triangle exception;

 BEGIN IF NOT (a+b>=c
               AND b+c>=a
               AND c+a>=b) THEN RAISE invalid_triangle;

 ELSE RETURN TRUE;

 END IF;

 exception WHEN invalid_triangle THEN dbms_output.put_line('xxxxxx- invalid triangle -xxxxxxxxxx');

 RETURN FALSE;

 WHEN others THEN dbms_output.put_line('un identified error occured');

 END;

